import { useState } from "react";
import { Link } from "react-router-dom";
import { logo } from "../assets/home";
import Container from "./Container";
import SidePanel from "./SidePanel.jsx"; // Import the side panel component

function Navbar() {
  const [isOpen, setIsOpen] = useState(false);
  const [isPanelOpen, setIsPanelOpen] = useState(false); // Track panel visibility

  // Toggle the visibility of the side panel
  const toggleSidePanel = () => {
    setIsPanelOpen(!isPanelOpen);
  };

  return (
    <nav className="py-2 z-40">
      <Container>
        <div className="flex items-center justify-between h-16">
          <div className="flex gap-4 items-center">
            <img className="h-[130px] w-[120px]" src={logo} alt="Workflow" />
            <div className="hidden md:block">
              <div className="ml-10 flex items-baseline space-x-4">
                <Link to="/Home" className="hover:bg-button-primary hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                  Home
                </Link>
                <Link to="/" className="hover:bg-button-primary hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                  Spotround
                </Link>
                <Link to="/admissions" className="hover:bg-button-primary hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                  Admissions
                </Link>
                <Link to="/about" className="hover:bg-button-primary hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                  About Us
                </Link>
                <Link to="/contact" className="hover:bg-button-primary hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                  Contact Us
                </Link>
              </div>
            </div>
          </div>

          {/* User Button */}
          <div className="relative">
            <button
              onClick={toggleSidePanel} // Open the side panel on click
              className="flex items-center hover:bg-button-primary px-4 py-2 rounded-xl"
            >
              <span className="text-sm font-medium">User</span> {/* Display User button */}
            </button>
          </div>

          {/* Mobile menu button */}
          <div className="-mr-2 flex md:hidden">
            <button
              onClick={() => setIsOpen(!isOpen)}
              type="button"
              className="bg-gray-800 inline-flex items-center justify-center p-2 rounded-md text-gray-400 hover:text-white hover:bg-gray-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-white"
              aria-controls="mobile-menu"
              aria-expanded="false"
            >
              <span className="sr-only">Open main menu</span>
              <i className="fas fa-bars"></i>
            </button>
          </div>
        </div>

        {/* Side Panel (toggle visibility based on isPanelOpen state) */}
        <SidePanel  
        isOpen={isPanelOpen}
        onClose={toggleSidePanel} // Function to close the side panel
        isLoggedIn={isLoggedIn} // Pass logged-in state
        userDetails={user} // Pass the user details when logged in
        onLogin={() => { /* Handle login logic here */ }}
        onSignup={() => { /* Handle signup logic here */ }}
        onLogout={() => { /* Handle logout logic here */ }}
         />
      </Container>
    </nav>
  );
}

export default Navbar;
